import { useNavigate, useSearchParams } from "react-router-dom";
import MyHeader from "../components/MyHeader";
import MyButton from "../components/MyButton";
import DiaryEditor from "../components/DiaryEditor";

const Edit = () => {
  const handleDelete = () => {
    console.log("삭제");
  };

  const handleEdit = () => {
    console.log("수정 완료");
  };

  const navigate = useNavigate();
  return (
    <div>
      <MyHeader
        leftChild={
          <MyButton
            text={"< 뒤로가기"}
            type={"default"}
            onClick={() => {
              navigate("/");
            }}
          ></MyButton>
        }
        headText={"일기 수정하기"}
        rightChild={
          <MyButton
            type={"negative"}
            text={"삭제하기"}
            onClick={handleDelete}
          ></MyButton>
        }
      ></MyHeader>
      <DiaryEditor></DiaryEditor>
      <div className="control_box">
        <MyButton
          type={"default"}
          text={"취소하기"}
          onClick={() => {
            navigate(-1);
          }}
        ></MyButton>
        <MyButton
          type={"positive"}
          text={"수정완료"}
          onClick={handleEdit}
        ></MyButton>
      </div>
    </div>
  );
};

export default Edit;
